import React from 'react';

const User = ({ username, id, password, created_at }) => {
  return (
    <div className='user-display'>
      <p>{username}</p>
      <p>{id}</p>
      <p>{password}</p>
      <p>{created_at}</p>
    </div>
  )
}

export default User;
